import React from 'react';

function Faculty() {
  const checkList = ["Apple", "Banana", "Tea", "Coffee"];

  return (
    <div className='facultyFilter'>
      <h4>Faculty</h4>
      
      <div className="list-container">
      {checkList.map((item, index) => (
        <div key={index}>
          <input value={item} type="checkbox" />
          <span>{item}</span>
        </div>
      ))}
      </div>
    </div>
  );
}

export default Faculty;
